    CFormInput,
    CFormLabel,
    CFormSelect,
    CRow,
    CForm,
    CToast,
    CToaster,
    CToastBody,
    CToastClose,

  } from '@coreui/react'


const tenantOverview = (props) => {

    const [name, setName] = useState('');
    const [type, setType] = useState('');

    useEffect(() => {
        (
            async () => {
                const response = await fetch('http://localhost:8080/api/user', {
